import React, { useState } from 'react';
import Auth from '../Auth';
import s from '../styles/Start.module.css';
const Start = () => {
  const [login, setLogin] = useState('false');
  const [props, setProps] = useState({
    name: '',
    email: '',
    password: '',
    username: ''
  });

  return (
    <div className={s.container}>
      {login && (
        <div className={s.wrapper}>
          <h1 style={{ color: 'white', margin: '0px', textAlign: 'center' }}>
            Welcome to Venus
          </h1>
          <p
            style={{
              color: 'white',
              margin: '0px',
              marginTop: '7px',
              textAlign: 'center'
            }}
          >
            Venus is a digital technology that facilitates the sharing of
            content, multimedia, and information through virtual networks and
            communities.
          </p>
          <br />
        </div>
      )}
      <Auth props={props} />
    </div>
  );
};

export default Start;
